window.bookSummaryJSON = "<p>Constance O' Day-Flannery is back, and better than ever with this new tale of magic and love.</p><p>Maggie O'Shea knows that because of her dark past, there's no place for love in her life. She owns a successful store in Philadelphia, where she uses her special gifts to help the people she meets. Though this doesn't fulfill her, she is content. Most of the time.</p><p> Entrepreneur Julian McDonald runs an empire. He's rich, cynical, bored - and not interested in relationships. He was in love, once, but since her death, there's been no space in his heart for anyone else.</p><p>Maggie knows as soon as she meets Julian that she could fall in love with him. But a secret society devoted to bringing the world back into balance has a mysterious agenda for Julian - and doesn't care about the heart's wish of a vulnerable shapeshifter...</p>"; 
